import styled from "styled-components";

export const StyledNav = styled.nav`
    display:flex;
    background-color: #0E0E0E;
    height: 44px;
    align-items: center;
    margin-bottom: 20px;
    padding-top:20px;
    padding-bottom: 20px;

`

export const StyledInput = styled.input`
    background-color: #373737;
    height:100%;
    border:none;
    width: 336px;
    position: relative;
    left:50%;
    color: #ffff;
`
